<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Stagger Reveal</title>

  <style>
    .boxes {
      width: 1000px;
      max-width: 90%;
      margin: 0 auto;
      display: flex;
      flex-flow: row wrap;
    }

    .box {
      display: flex;
      align-items: center;
      justify-content: center;
      width: 300px;
      height: 200px;
      margin: 16px;
      background-color: #eee;
      border-radius: 6px;

      opacity: 0;
      /* For stagger reveal */
    }

    .box:nth-of-type(5n+1) {
      background-color: #dd8c8c;
    }

    .box:nth-of-type(5n+2) {
      background-color: #95b2dd;
    }

    .box:nth-of-type(5n+3) {
      background-color: #e2b4b4;
    }

    .box:nth-of-type(5n+4) {
      background-color: #99e2b5;
    }

    .box:nth-of-type(5n+5) {
      background-color: #9eebeb;
    }
  </style>
</head>
